import React from 'react';

const Title = (title) => {
    return (
        <div style = {styles.container} >
            <text style = {styles.text}>title</text>
        </div>
    );
};

const styles = {
    container: {
        backgroundColor: '#2a2829',
        flex: '100%',
    },

    text: {
        fontSize: '30px',
    },
};

export default Title;
